import React from "react";
import ReactDOM from "react-dom";
import pic from "./bluelogo.png";

const fname = "Manu";
const lname = "Gupta";
const curr = new Date();
const links = "https://www.linkedin.com/in/manugupta9780/";

ReactDOM.render(
	<>
		<h1 contentEditable="true">{`My name is ${fname} ${lname}`}</h1>
		<p>{`Current Date is ${curr.toLocaleDateString()}`}</p>
		<p>{`Current Time is ${curr.toLocaleTimeString()}`}</p>
		<a href={links} target="__manu">
			<img src={pic} alt="randomImage" />
		</a>
	</>,
	document.getElementById("root")
);
